showEvent( 5 );

function showEvent( count ) {
  const map = {
    'red': 'green',
    'green': 'red',
  }
  const color = ( nodeData.color == 'gray'? 'red': map[nodeData.color] );
  setNodeDataField( nodeData.key, 'color', color );
  if( count > 0 ) {
    setTimeout( ()=> showEvent( count-1 ), 500 );
  } else {
    setNodeDataField( nodeData.key, 'color', 'gray'  );
  }
}

