const voiceMap = graphData.dfe.getProperty( nodeData, 'voiceMap', '' );
let voiceMapList = jsyaml.load( voiceMap );

// Extract the array that match the browser voice configuration
if( !Array.isArray( voiceMapList )) {
  const voiceList = getVoiceList();
  const voiceListStrArray = voiceList.map( (e ,i)=> `id: ${i}, name: ${e.name},  lang: ${e.lang}` );

  const shaKey = SHA1( JSON.stringify( voiceListStrArray ) );
  const key = shaKey.substring( 0, 6 );
  if( voiceMapList[key] ) {
    voiceMapList = voiceMapList[key];
  } else {
    voiceMapList = [];
  }
}

let voiceId = 0;
if( voiceMapList && voiceMapList.length ) {
  let voiceName = '';
  voiceMapList.forEach( (e)=> { if( value.sender == e.name ) voiceName = e.voice } );
  voiceId = getVoiceIdFronName( voiceName );
}

if( !value.text.endsWith( '(silence)' ) ) {
  saySentence( value.text, voiceId, fireOnStop );
  graphData.dfe.fireOutput( nodeData, 'onStart' );
} else {
  fireOnStop();
}
function getVoiceIdFronName( name ) {
  const voiceList = getVoiceList();
  for( let i = 0; i < voiceList.length; ++i ) {
    const voice = voiceList[i];
    if( voice.name == name ) {
      return( i );
    }
  }
  return( 0 );
}
function getVoiceList() {
  let result = [];

  result = speechSynthesis.getVoices();
  if( !result ) {
    result = speechSynthesis.getVoices();
  }
  return( result );
}
function fireOnStop() {
  graphData.dfe.fireOutput( nodeData, 'onStop' )
}
function saySentence( message, voiceId, onEnd ) {
  // Select voice
  //let voiceId = 0;
  // VoiceList cache
  let voiceList = null;

  // Callback when tts finished speaking
  const onTTSEnd = ()=> {
    if( onEnd ) {
      onEnd();
    }
  }

  let isVoicePresent = false;
  let utterance = null;
  // Get voice
  utterance = new SpeechSynthesisUtterance( message );
  utterance.onerror = console.log;
  //console.log( 'say', this.voiceId, message);



  // If we got the list of voices
  if( voiceList && voiceList.length ) {
    // Get a correct index for a voice
    const vIdx = voiceId % voiceList.length;
    // Set voice
    utterance.voice = voiceList[vIdx];
    isVoicePresent = true;
  }

  //if( isVoicePresent && utterance ) {
  if( utterance ) {
    utterance.addEventListener( 'end', onTTSEnd, { once: true } );
    speechSynthesis.speak( utterance );
  } else {
    // Use heuristic timer to call the on end
    const timeout = Math.max( 2, message.length*200 );
    setTimeout( onTTSEnd, timeout );
  }
}","fileTypeName":"Component","fileType":"text/javascript","iconURL":"","key":129,"location":"43050 7180","editorPosition":[2286,281,809,799]},
